               Brainwave Suite: Sleep and Rejuvenation - 2010kaiser
               ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~


Album of deep relaxation 'Brainwave Suite: Sleep &amp; Rejuvenation' by Dr. Jeffrey Thompson. The first track contains the soothing sounds of chirping birds, bubbling brook and resonant tones of Tibetan bowls. The second track contains the quiet sounds of the ocean waves, the songs of whales and dolphins.

Title: Brainwave Suite: Sleep and Rejuvenation.
Author: Dr. Jeffrey Thompson.
Year: 2007.
Publisher: The Relaxation Company.
Format: FLAC (Lossless).



